import React, { useState } from "react";
import { Login } from "../../Redux/Slice/Auth/auth.slice";
import { useDispatch, useSelector } from "react-redux";
import toast from "react-hot-toast";
import ToastButton from "../../Helpers/Toast";
import { Link, useNavigate } from "react-router-dom";

// Login

const Auth = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const [UserName, setUserName] = useState("");
  const [Password, setPassword] = useState("");
  const [LoginDetails, setLoginDetails] = useState([]);

  const SignInUSer = async (e) => {
    e.preventDefault();
    const res = await dispatch(Login({})).unwrap();
    if (res.status) {
      if (res.data.role === 0 || "0") {
        navigate("/admin/dashboard");
      } else if (res.data.role === 1 || "1") {
        navigate("/subadmin/dashboard");
      } else if (res.data.role === 2 || "2") {
        navigate("/user/dashboard");
      }
      localStorage.setItem("user_details", JSON.stringify(res));
      setLoginDetails(res);
    } else {
      toast.error(res.msg);
    }
  };

  return (
    <>
      <div className="container ">
        <div
          className="row d-flex align-items-center justify-content-center"
          style={{ height: "100vh" }}
        >
          <div className="hero">
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
            <div className="cube" />
          </div>
          <div className="col-sm-10 col-md-8 col-lg-5">
            <div className="middle-box py-4">
              <div className="card">
                <div className="card-body p-4">
                  {/* Logo */}
                  <h4 className="font-24 mb-30">Login2</h4>
                  <form action="#">
                    <div className="form-group mb-3">
                      <input
                        className="form-control login"
                        type="email"
                        id="emailaddress"
                        required=""
                        placeholder="Enter your email"
                        style={{
                          backgroundImage: 'url("data:image/png',
                          backgroundRepeat: "no-repeat",
                          backgroundSize: 20,
                          backgroundPosition: "97% center",
                          cursor: "auto",
                        }}
                        onClick={(e) => setUserName(e.target.value)}
                      />
                    </div>
                    <div className="form-group mb-3">
                      <a
                        href="forget-password.html"
                        className="text-dark float-right"
                      />
                      <input
                        className="form-control login"
                        type="password"
                        required=""
                        id="password"
                        placeholder="Enter your password"
                        onClick={(e) => setPassword(e.target.value)}
                      />
                    </div>
                    <div className="form-group d-flex justify-content-between align-items-center mb-3">
                      <span>
                        <a
                          className="font-12 text-success"
                          href="forget-password.html"
                        >
                          Forgot your password?
                        </a>
                      </span>
                    </div>
                    <div className="form-group mb-0">
                      <button
                        className="btn btn-primary btn-block"
                        type="submit"
                        onClick={(e) => SignInUSer(e)}
                      >
                        Log In
                      </button>
                    </div>
                    <div className="text-center mt-15">
                      <span className="mr-2 font-12">
                        Don't have an account?
                      </span>
                      <Link className="font-12" to={"/signup"}>
                        Sign up
                      </Link>
                    </div>
                  </form>
                  {/* end card */}
                </div>
              </div>
            </div>
          </div>
          <ToastButton />
        </div>
      </div>
    </>
  );
};

export default Auth;
